app_version: 1.0.0
name: AWS Lambda
description: An app to interact with Amazon Lambda
contact_info:
  name: "@shalinbhavsar"
  url: https://shuffler.io
  email: shalinbhavsar17@gmail.com
tags:
  - MISP
  - AWS
categories:
  - MISP
authentication:
  required: true
  parameters:
    - name: access_key 
      description: The access key to use
      example: "*****"
      required: true
      schema:
        type: string
    - name: secret_key
      description: The secret key to use 
      example: "*****"
      required: true
      schema:
        type: string
    - name: region 
      description: The region to use
      example: "ap-south-1"
      required: true
      schema:
        type: string
actions:
  - name: list_functions 
    description: Lists all lambda functions
    returns:
      schema:
        type: string
  - name: get_function
    description: Returns information about the function or function version.
    parameters:
      - name: function_name
        description: The name of the lambda function, version or alias
        required: true
        schema:
          type: string
      - name: qualifier
        description: Specify a version or alias to get details about a plublished version of the function
        required: false
        schema:
          type: string
    returns:
        schema:
          type: string
  - name: list_aliases
    description: Returns a list of aliases for a lambda function
    parameters:
      - name: function_name
        description: The name of the lambda function, version or alias
        required: true
        schema:
          type: string
      - name: function_version
        description: Specify a function version 
        required: false
        schema:
          type: string
    returns:
      schema:
        type: string
  - name: invoke
    description: Invokes a lambda function
    parameters:
      - name: function_name
        description: The name of the lambda function, version or alias
        required: true
        schema:
          type: string
      - name: invocation_type
        description: Invocation types
        required: true
        example: RequestResponse
        options:
        - RequestResponse
        - Event
        - DryRun
        schema:
          type: string
      - name: logtype
        description: Set to Tail to include the execution log in the response.
        required: true
        example: None
        options:
        - None
        - Tail
        schema:
          type: string
    returns:
      schema:
        type: string  
  - name: get_account_settings
    description: Retrives details about your account's limits and usage
    returns:
        schema:
          type: string
  - name: delete_function
    description: Deletes a Lambda function
    parameters:
      - name: function_name
        description: The name of the lambda function, version or alias
        example: my-function
        required: true
        schema:
          type: string
      - name: qualifier
        description: Specify a version or alias to get details about a plublished version of the function
        required: false
        schema:
          type: string
    returns:
        schema:
          type: string
